.
[Lung Expansion - Retention]

Breath in Yoga:
“Breath work is an ancient practice.  – cultures around the world since the dawn of humanity have been using the breath as a way to take in spiritual nourishment, purify the body, cultivate presence and to move into expanded states of consciousness.” Breathing is a way of life. With breathing practice, you could control your body and mind, and spirit to connect to the universe - that’s the amazing wholeness that Yoga brings!
.
Today I’ll show you a sacred breathe retention. You might have tried holding your breath as long as possible when you were a child ☺️ When we become an adult, we are naturally more afraid of holding our breath, because we naturally associate it with a near death experience. In fact, when we are in lack of oxygen, we are experiencing a small death, some small parts of the body cells are dying in you.
.
However! Did you know you could find the deepest sense of peace when you are holding your breath? You could connect deep into yourself, and experience absolute tranquility. The stillness is a powerful and great cleanse of your body and mind. As parts of your old cells are dying, you could let go an old version of yourself, ego, or whatever you need to let go.
.
After this breathing exercise, your sense of awareness will become sharper. You might see colors more vividly. You will feel more balanced, high energy, calmness, rejuvenated, refreshed and reborn🧘🏻‍♀️
.
.
Lung Expansion:
1. Come to the comfortable seated position.
2. Inhale deeply as much as you can until you can’t inhale anymore, expand the lungs, and hold the breath.
3. Try 3 rounds with small breaks - Retaining the breath for 30 seconds, 60 seconds, and 90 seconds.
4. I recommend going into the silent meditation after this practice.
***If at any point you feel dizzy or you have to let it out, try to let out a little, and inhale more. This will help stretch the capacity of lungs, and increase your lung capacity over time.
.
