meu corpo e a minha alma com o que há de melhor: frutas e vegetais, comida que vem da terra, cheia de energia vital, de água, de vitaminas e sais minerais, além amor, autocuidado e boas companhias 🐈 (ainda que neste momento a conexão com as pessoas que amo seja só digital)! ⭐️🌈❤️🌳🐒 Que tal se desafiar também a experimentar a liberdade e os benefícios de viver de forma natural e saudável, por uma semana? Desafie alguém nos comentários a comer mais frutas e verduras cruas . Vem aí o desafio @semanafrugi #nandafrugi #sextasemalcool #alcoholfree #vegana #frugívora #frugivorismo #tequila #aguadecoco #saúde #rawvegan #vegan";}i:212;a:1:{s:14:"comments_count";i:39;}i:213;a:1:{s:11:"likes_count";i:712;}i:214;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEu9fV5n3Ap";}i:215;a:1:{s:5:"image";s:249:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118792262_315811373179667_6442075465091614795_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=111&_nc_ohc=eUQiJZ6zVJcAX8w8evz&oh=c4505cd119699a68c1641a5aa14cf90c&oe=5F7DD77A";}i:216;a:1:{s:4:"type";s:5:"image";}i:217;a:1:{s:8:"owner_id";i:456992112;}i:218;a:1:{s:14:"owner_username";s:0:"";}i:219;a:1:{s:14:"owner_fullname";s:0:"";}i:220;a:1:{s:9:"owner_pic";s:0:"";}i:221;a:1:{s:2:"id";s:19:"2391117844946838490";}i:222;a:1:{s:10:"short_code";s:11:"CEu9QLkJ2Pa";}i:223;a:1:{s:12:"created_time";i:1599263481;}i:224;a:1:{s:7:"caption";s:193:"The easiest #rawvegan dish ever! Swipe to see the pesto process and the @sherunsonplants TikTok debut! Also added about another half cup of basil and a little lemon juice not shown in the video";}i:225;a:1:{s:14:"comments_count";i:1;}i:226;a:1:{s:11:"likes_count";i:25;}i:227;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEu9QLkJ2Pa";}i:228;a:1:{s:5:"image";s:249:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118702042_385765979254841_2972869796987084689_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=105&_nc_ohc=9sNl3qF9pFoAX-